import React, { useEffect, useState } from 'react'
import '../task2.css'
import { useParams } from 'react-router'
import axios from 'axios'

function Dashboard() {
  const { id } = useParams()
  useEffect(async () => {
    const getLists = axios.get(
      `https://api.trello.com/1/boards/${id}/memberships?key=4771cda06157329944b577f382bc2cf3&token=7a1c5dce94fc3f0026f3df596e11727bbb51730447ebc0e0f3732ccca73c5e86`
    )
  })
  console.log(id)
  return (
    <div className="DashBoard">
      <h1>user {id}</h1>
    </div>
  )
}

export default Dashboard
